import React from 'react'

import { BrowserRouter as Router } from 'react-router-dom';
import { GlobalStyle } from './globalStyle';
import Hero from './Components/Hero';
import Potraits from './Components/Potraits';


function App() {
  return (
    <Router>
      <GlobalStyle />
      <Hero/>
      <Potraits/>
    </Router>
  );
}

export default App;
